import React, { useState } from "react";

const AudioPlayback = () => {
  const [error, setError] = useState<string | null>(null);

  return (
    <div>
      {error ? (
        <p>Error: {error}</p>
      ) : (
        <audio controls onError={() => setError("Failed to load audio. Please try again later.")}>
          <source src="http://localhost:8080/stream-audio" type="audio/wav" />
          Your browser does not support the audio element.
        </audio>
      )}
    </div>
  );
};

export default AudioPlayback;
